<p>In this lab, you will implement a streaming pipeline with the intention of capturing data changes from a source system and delivering those changes in real time to a target system. </p>
<ul>
<li><a href=#1>1 - Introduction</a></li>
<li><a href=#2>2 - CDC Infrastructure</a></li>

<div id=1>
<h2>1 - Introduction</h2>
<p>Change data capture (CDC) refers to a software process or design pattern that can detect changes to a source system (such as a database or data warehouse), as you can keep track of changes in near real-time, you can implement processes that achieve data consistency in data sources down the line of the source. </p>
<p>A requirement has come through for your team to implement a CDC system from a source MySQL database to a target RDS database running Postgres. The rest of the team has set up a prototype of the architecture in an EC2 instance, the missing configuration and Flink pipeline have been left for you to develop and finally test the architecture.</p>

<p>The prototype has mostly been set up using a multi-container approach inside an EC2 instance, you can connect with the EC2 instance using an SSH tunnel. Here is a brief description of the components:</p>
<ul>
<li>
<p><strong>Source Database:</strong> You already interacted with the source database in previous labs. For the prototype, the team set up a MySQL database inside a Docker container with the <code>classicmodels</code> database.</p>
</li>
<li>
<p><strong>Debezium:</strong> Distributed platform for CDC, it connects to the source system and captures the changes based on the configuration one setup. The UI has been provisioned with the <code>8080</code> port of the EC2 instance.</p>
</li>
<li>
<p><strong>Apache Kafka:</strong> The event streaming platform, has already been configured to connect with Debezium, based on your configuration in Debezium topics are created for each table that contains messages with each change. </p>
</li>
<li>
<p><strong>Apache Zookeeper:</strong> Service that stores configuration information and allows the coordination of cloud applications. </p>
</li>
<li>
<p><strong>Apache Zeppelin:</strong> Web-based notebook environment, it allows us to run Flink in a notebook alongside other possible interpreters. You can access the UI by connecting to the <code>8085</code> port of the EC2 instance, you can also see the Flink UI with the <code>8086</code> port.</p>
</li>
<li>
<p><strong>Apache Flink:</strong> Distributed processing engine for data streams, you will use it to connect to the Kafka topics and update the target database accordingly.</p>
</li>
<li>
<p><strong>Target Database:</strong> For the prototype, the team set up a Postgres database in an RDS instance with the target schema <code>classicmodels_star_schema</code>.</p>
</li>
</ul>

<p>3.1.3. Navigate to the <strong>CloudFormation</strong> section in the AWS console, click on the alphanumeric ID of the deployed stack and search for the <strong>Outputs</strong> tab. Through the lab, you will need the values corresponding to the keys <code>ZeppelinUI</code>, <code>DebeziumUI</code>, <code>FlinkUI</code>, and <code>PostgresEndpoint</code>. </p>
<div id=3.2>
<h3>3.2 - Zeppelin Interpreters</h3>
<p>Configure the interpreters to access the source and target database. In Apache Zeppelin, an interpreter is a plug-in that allows Zeppelin to run code in different languages, in your 
case it will allow us to run queries in Flink SQL, MySQL and Postgres.</p>

<li>
<p>Wait for around 1 to 2 minutes and then, execute the following command:</p>
<pre><code class=language-bash>  curl -i -X POST -H &quot;Accept:application/json&quot; -H  &quot;Content-Type:application/json&quot; http://localhost:8083/connectors/ -d @conf/mysql_conf.json</code></pre>
</li>
<li>
<p>To check that the Debezium connection is ready, you can go to the <code>DebeziumUI</code> or run the command:</p>
<pre><code class=language-bash>  sudo docker compose -f docker-compose-flink.yml exec kafka kafka-topics --bootstrap-server kafka:9092 --list</code></pre>
</li>
</ul>

<p>Click on <strong>Save</strong> button.</p>
<p>3.2.5. Add the Interpreter to connect to the target Postgres database. Click the Create button on the Interpreter's page again, the Interpreter name will be <code>psql</code> and the group <code>jdbc</code>.</p>
<p>Then in the properties, put the following values in the fields, replacing the placeholder <code>&amp;lt;POSTGRES_ENDPOINT&amp;gt;</code> with the value of the <code>PostgresEndpoint</code> output (make sure that you replace the whole placeholder, including the brackets <code>&amp;lt;&amp;gt;</code>):</p>
<ul>
<li><strong>default.url:</strong> <code>jdbc:postgresql://&amp;lt;POSTGRES_ENDPOINT&amp;gt;:5432/postgres</code></li>
<li><strong>default.user:</strong> <code>postgresuser</code></li>
<li><strong>default.password:</strong> <code>adminpwrd</code></li>
<li><strong>default.driver:</strong> <code>org.postgresql.Driver</code></li>
</ul>
<p>Finally, add the artifact <code>org.postgresql:postgresql:42.7.3</code> in the dependencies section. Finish by clicking on <strong>Save</strong> button.</p>

<h2>4 - CDC Pipeline and Flink UI</h2>
<p>For the CDC Pipeline, you will create a simple star schema architecture based around the <code>classicmodels</code> orders. The target database has a schema named <code>classicmodels_star_schema</code> and the corresponding tables:</p>
<ul>
<li><strong>fact_orders</strong>: A fact table based on the <code>orders</code> and <code>orderlines</code> tables. It contains information for each order item, the order itself, the product and the customer.</li>
<li><strong>dim_customers</strong>: A dimensional table based on the information for each client, based on the <code>customers</code> table.</li>
